import React from "react";
import bgVideo from "../Images/About.mp4";
import "./css/videoBg.css";

function VideoBgSection() {
  return (
    <React.Fragment>
      <div className="d-flex justify-content-center videoBg-div">
        <video src={bgVideo} autoPlay muted loop className="ms-auto"></video>
        <div className="text-on-video-head text-white">
          <h1>About Us</h1>
        </div>
      </div>
      <div className="text-on-video-head text-white">
        <h1>About Us</h1>
      </div>
    </React.Fragment>
  );
}

export default VideoBgSection;
